import React from 'react';


export class Message extends React.Component {

    render() {
        return (
            <div className='message-item'>
                {this.props.senderName === this.props.currentUser}
                <div><b>{this.props.senderName}</b></div>
                <span>{this.props.text}</span>
            </div>
        )
    }
}
